import React, { Component } from "react";

import loader from "../Loader/img/loader.svg";
import "./styles.scss";

class Loader extends componet {
  render() {
  return (
    <React.Fragment>
      <section className="loaderPlay">
        <img src={loader} alt="loading" className="loadingPlay"/>
      </section>
    </React.Fragment>
  );
}};

export default Loader;
